TWComponent.script:
if (tw.local.htmlResult && tw.local.htmlResult.indexOf("LDAP authentication successful!") != -1 && tw.local.htmlResult.indexOf(tw.local.WebServerConfig.ValidationText) != -1) {
tw.local.WebServerStatusMessage = "Success: LDAP Connection and validation Passed " + new TWDate();
}else {
tw.local.WebServerStatusMessage = "Error: LDAP connection and validation did not succeed" + new TWDate();
}

if (tw.system.error){
tw.local.htmlResult = tw.system.error.toString(true);
}

